INSERT INTO `you_prefix_table_f_posts` VALUES('283', '223', '2', '2', '4', '83.237.80.242', '1268140345', '1', '0', '1', '1', '1', '1', '', 'Добро пожаловать в phpBB3', 'Это пример сообщения на вашей конференции phpBB3. Всё работает правильно. Вы можете удалить это сообщение и продолжить настройку вашей конференции. В процессе установки вашей первой категории и первому форуму были заданы подходящие права доступа для предустановленных групп администраторов, супермодераторов, гостей, зарегистрированных пользователей и зарегистрированных в соответствии с COPPA пользователей. Если вы решите удалить вашу первую категорию и первый форум, не забудьте установить права доступа для всех новых категорий и форумов, которые вы создаёте. Рекомендуем переименовать вашу первую категорию и первый форум и копировать права доступа с них вновь создаваемым категориям и форумам. Удачи!', '12a5f8ecb1edffec4e9b0d14d121d523', '0', '', 'nhj68jfc', '1', '0', '', '0', '0', '0'),('285', '225', '2', '4209', '0', '222.77.218.167', '1387449570', '1', '0', '1', '1', '1', '1', '', '&quot;Every day dozens of buses, loaded with Chinese tourists on ', '&lt;a href=&quot;http://www.xunjie.com/&quot;&gt;xunjie&lt;/a&gt;[url=http&#58;//www&#46;xunjie&#46;com/:p3pthjlb]xunjie[/url:p3pthjlb] \nп»їСезона 2009-2010 ЦБ, вторая половина (раздел 18) стартовала минувшей ночью в &quot;Яо босс&quot; команда Шанхае вторую половину огонь после подписания часто щедрые команда Шаньси станет главным героем второго тайма &quot;независимости Волк &quot;в главной роли Марбери завершит CBA&quot; первый Maiguai, после продажи обуви &quot;сценарий. Яо Мин стал босса команды Шанхае после того как команда получила беспрецедентное внимание, будь то у себя дома смотреть, или уходите контролировать операции, подлежат всеобщее внимание [url=http&#58;//boot&#46;artexauto&#46;com/:p3pthjlb]угги австралия[/url:p3pthjlb]\n . Большинство поклонников признался: &quot; [url=http&#58;//www&#46;ncp12&#46;ru/:p3pthjlb]угги оптом[/url:p3pthjlb