COMMENT 'Title (заголовок):',   `description` tinytext CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT 'Description (описание):',   `keywords` tinytext CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT 'Keywords (ключевые слова):',   `nivo_slider` tinytext CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT 'Изображение ротации:',   PRIMARY KEY (`page_id`),   KEY `parent_id` (`parent_id`),   KEY `nesting` (`nesting`),   KEY `access_inherited` (`access_inherited`) ) ENGINE=MyISAM AUTO_INCREMENT=51707 DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='Страницы сайта';
