atalog.php~}', '10', '', '', '', ''),('13', '0', '1', '40', '0', '0', '1207390650', '1327832339', 'Форум', '0', '0', '0', '0', '0', '0', '0', '', '', '30', '', '', '', ''),('5698', '31', '2', '150', '0', '7', '1290319581', '1328870150', 'RSS раздела', '0', '0', '0', '0', '0', '0', '', '', '{~rss_section.php~}', '0', '', '', '', ''),('32707', '31', '2', '150', '0', '7', '1303466068', '1325843358', 'Добавление закладки', '0', '0', '0', '0', '0', '0', '0', '', '{~page_bookmark_add.php~}', '0', '', '', '', ''),('33112', '31', '2', '160', '0', '7', '1303821677', '1322750531', 'Авторизация Вконтакте', '0', '0', '0', '0', '0', '0', '0', '', '', '0', '', '', '', ''),('33363', '31', '2', '190', '0', '7', '1305702487', '1322815632', 'Учетная запись', '0', '0', '0', '0', '0', '0', '0', '', '', '0', '', '', '', ''),('51337', '0', '1', '10', '7', '7', '1322139084', '1326038051', 'Личные страницы', '0', '0', '0', '0', '0', '0', '0', '', '', '0', '', '', '', ''),('51573', '0', '1', '70', '0', '0', '1325659002', '1327839536', 'Google', '0', '0', '0', '0', '0', '0', '', '', '{~catalog.php~}', '40', '', '', '', ''),('51577', '51573', '2', '10', '0', '0', '1267704536', '1329485950', 'Google вводит систему интернет-паспортов', '0', '0', '0', '0', '0', '0', 'Google,OIX, Open Identity Exchange', '/uploads/users/2/2012/01/27/4d0d90b0948788f91998c92ef9478da9_5B1_5D_1267704778_1__1327679409.jpg', '<p>Система OIX предоставит компаниям и ведомствам, ведущим  деятельность в   Интернете, специальные идентификаторы &mdash; &laquo;удостоверения  личности&raquo;, по   которым их будут опознавать государственные органы.<!-- pagebreak --></p>\r\n<p>Основная цель системы OIX (Open Identity Exchange &mdash; букв. &laquo;обмен  открытыми идентификациями&raquo;) &mdash; предоставить онлайновые &laquo;удостоверения  личности&raquo; организациям, работающим в государственном и частном секторах.</p>\r\n<p>Систему OIX не следует путать с OpenID &mdash; открытой децентрализованной  системой единого входа на сайты, порталы, блоги и форумы. OIX будет  предоставлять доступ не к <a class=\"lnk\" href=\"http://www.securitylab.ru/news/382591.php\">Facebook</a> или <a class=\"lnk\" href=\"http://www.securitylab.ru/news/381869.php\">Twitter,</a> а на сайты, управляемые правительством США, передает Mashable.</p>\r\n<p>Прежде чем получить &laquo;интернет-паспорт&raquo;, организации или ведомству  нужно будет пройти многоуровневую процедуру проверки. Проводить проверку  имеет право только уполномоченная организация в рамках системы OIX.  Сейчас такими организациями являются Google, PayPal и американское  агентство кредитной информации Equifax. Если проверка пройдена успешно,  организации будут выданы &laquo;ключи&raquo; для доступа к государственным сайтам.</p>\r\n<p>По словам одного из руководителей OIX Дона Тибо (Don Thibeau),  организациям, которые прошли проверку, также может быть предоставлен  доступ к сайтам некоммерческих организаций, телекоммуникационных  компаний, научных сетей и т.д.</p>\r\n<p>OIX является некоммерческой организацией. О ее создании было  объявлено 3 марта на конференции RSA, посвященной вопросам  информационной безопасности. В разработке системы принимали участие  несколько ведущих IT-корпораций &mdash; в их числе Google, PayPal и Verizon.</p>', '0', '', '', '', ''),('51578', '51573', '2', '30', '0', '0', '1267704907', '1327679946', 'На Google напали хакеры-недоучки', '0', '0', '0', '0', '0', '0', 'Google, хакер', '/uploads/users/2/2012/01/27/c6d94269e02f592204b4d74a38985a8f_5B1_5D_1267704940_1__1327679488.jpg', '<p>Американские специалисты по компьютерной безопасности уверены, что   недавние атаки на Google были подготовлены <a class=\"lnk\" href=\"http://www.securitylab.ru/\">хакерами</a> с весьма  невысоким уровнем технической подготовки.<!-- pagebreak --></p>\r\n<p>Напомним, что 12 января этого года хакеры устроили кибератаки на  Google. От рук злоумышленников также пострадали правительственные сети  Индии, внутренние ресурсы Intel и Adobe и сотни других компаний по всему  миру. Специалисты из <a class=\"lnk\" href=\"http://www.securitylab.ru/software/1250/\">антивирусной</a> фирмы <a class=\"lnk\" href=\"http://www.securitylab.ru/software/267529.php\">McAfee</a> назвали хакерскую атаку &laquo;изощренной и многосторонней&raquo;.</p>\r\n<p>Однако сотрудники компании Damballa, занимающейся вопросами  компьютерной безопасности, так не считают. По их мнению, в ботнете,  подготовленном злоумышленниками, не было ничего особенного, а сами  исполнители атаки продемонстрировали весьма посредственный уровень  технической подготовки.</p>\r\n<p>&laquo;В этот ботнет не было вложено много средств, поэтому я бы не стал  предполагать, что атака была заказана властями, &mdash; заявил Гантер Оллменн  (Gunter Ollmann), вице-президент Damballa. &mdash; Если бы это было  действительно так, хакеры использовали куда более продвинутые средства&raquo;.</p>\r\n<p>Он добавил, что ботнет Aurora, активное тестирование которого  началось за полгода до атаки, не стоит считать суперсекретной  правительственной разработкой, скорее это всего лишь несложная поделка  команды хакеров-любителей. По словам Оллменна, некоторые фрагменты его  программного кода впервые были написаны как минимум пять лет назад, а  технологии, используемые в данной атаке, устарели настолько, что  профессиональные операторы ботнетов давно от них отказались.</p>', '0', '', '', '', ''),('51579', '51573', '2', '20', '0', '0', '1267705236', '1328784417', 'Microsoft организовала компанию против Google посредством маленьких третьих фирм', '0', '0', '0', '0', '0', '0', 'Google', '/uploads/users/2/2012/01/27/d8460dc7df1ba744711b24c8fd4fb131_5B3_5D_1267710661_1__1327679541.jpg', '<p>На прошлой неделе Евросоюз начал антимонопольное расследование против    Google, инициированное маленькими компаниями, близкими к  <a href=\"http://clk.atdmt.com/MRR/go/199659073/direct/01/\">Microsoft.</a> Оказывается, это не единичный случай.<!-- pagebreak --></p>\r\n<p>The Wall Street Journal приводит  доказательства так называемой &laquo;прокси-войны&raquo;, то есть глобальной  кампании, которую организовала <a class=\"lnk\" href=\"http://www.securitylab.ru/forum/forum18/\">Microsoft</a> против Google посредством маленьких третьих фирм и на первый взгляд не  связанных друг с другом дел. Подобных &laquo;антимонопольных&raquo; дел становится  все больше и больше, они начинаются в отдельных странах и городках США,  но, что удивительно, против Google в них выступают высокооплачиваемые  адвокаты из лучших юридических контор, а иногда и &laquo;бывшие&raquo; топ-юристы  Microsoft, теперь якобы ведущие независимый юридический бизнес.  Например, дело маленькой фирмы в Огайо против Google ведет знаменитый  Чарльз Рул (Charles &laquo;Rick&raquo; Rule), бывший руководитель антимонопольного  комитета Министерства юстиции США.<br /> <br /> По мнению аналитиков, в ближайшее время можно ожидать, что многие мелкие  дела сольются в один масштабный процесс против онлайновой &laquo;монополии&raquo;  Google. Результаты могут быть катастрофическими, такими же, как  результаты антимонопольного процесса против Microsoft в конце 90-х.  Корпорация так и не смогла исправить свой имидж после того громкого  процесса. До его начала это была перспективная инновационная фирма, а  после процесса она превратилась в глазах публики в монополиста и  &laquo;корпорацию зла&raquo;, причём не может изменить этот имидж до сих пор.<br /> <br /> Microsoft отвергает обвинения в инициации исков, но подтверждает  готовность оказать юридическую помощь в подготовке исков всем  пострадавшим от какой бы то ни было монополии.<br /> <br /> При участии Microsoft в Европе создана организация ICOMP (Initiative for  a Competitive Online Marketplace), единственной мишенью юридических  претензий которой является пока только одна компания. Разумеется, это  Google.</p>', '0', '', '', '', ''),('51580', '0', '1', '70', '0', '0', '1325764957', '1327839569', 'Разное', '0', '0', '0', '0', '0', '0', '0', '', '{~inner/catalog.php~}', '50', '', '', '', ''),('51600', '0', '1', '70', '0', '0', '1326100005', '1327839631', 'Контакты', '0', '0', '0', '0', '0', '0', '0', '', '<p>Свои вопросы, предложения и замечания можете писать нам с помощью формы ниже.</p>\r\n{~comments.php~}', '55', '', '', '', ''),('51631', '51580', '2', '30', '0', '0', '1267703798', '1327679890', 'Кардер на допросе сьел флеш накопитель', '0', '0', '0', '0', '0', '0', '', '/uploads/users/2/2012/01/27/fa4a9ce5c9c15013f7bcbb24f66aff09_255B2_255D_1267703475_5B1_5D_1267703829_1__1327679699.jpg', '<p>Житель Нью-Йорка, подозреваемый в краже денежных средств с кредитных  карточек, в ходе допроса проглотил собственный USB-накопитель Kingston.<!-- pagebreak --> Теперь к списку обвинений будет добавлен еще один пункт &mdash;  &laquo;препятствование отправлению правосудия&raquo;.<br> <br> 21 января 2010 года Флорин Некула (Florin Necula) был арестован возле  здания банка в районе Куинс, Нью-Йорк, США. Полиция подозревала, что  Некула с сообщниками помещали в банкоматы устройство, считывающее  информацию с магнитной полоски на карте.<br> <br> В ходе допроса Некула достал флэш-накопитель, который имел при себе во  время ареста, и проглотил его на глазах у следователей, сообщается в  отчете агента Джозефа Боргера (Joseph Borger).<br> <br> Источник издания The Smoking Gun сообщает, что флэшку из желудка Некулы  удалили врачи из местного госпиталя &mdash; они опасались, что здоровью  подсудимого будет нанесен урон, если предмет будет оставаться внутри.  Естественным путем USB-накопитель вывести из организма не удалось.<br> <br> Удалось ли спасти данные с флэшки, пока неизвестно. Журналисты The  Smoking Gun связалась с компанией Kingston и спросили, оказывает ли  желудочный сок воздействие на USB-накопители. Сотрудник Kingston Майк  Сагер (Mike Sager) ответил, что не владеет информацией, так как компания  не проводила соответствующих испытаний.</p>', '0', '', '', '', ''),('51694', '51580', '2', '20', '0', '0', '1267704857', '1327679872', 'На Linux Expo выступили 12-летние девочки', '0', '0', '0', '0', '0', '0', 'SCALE, Southern California, Малакай Уэйд, Linux', '/uploads/users/2/2012/01/27/eceee370b6c806655f81db747a8224e7_5B3_5D_1267782076_1__1327679755.jpg', '<p>На недавно прошедшем в США мероприятии SCALE (Southern California <a class=\"lnk\" href=\"http://www.securitylab.ru/forum/forum21/\">Linux</a> Expo) была  представлена секция &laquo;Женщины в Open Source&raquo;. Что вызвало   немалое  удивление публики, в ней выступили две 12-летние девочки.<!-- pagebreak --></p>\r\n<p>12-летние Малакай Уэйд (Malakai Wade) и Мирано Кафьеро (Mirano  Cafiero) рассказывали о  <a href=\"http://www.securitylab.ru/bitrix/rk.php?id=8&amp;event1=banner&amp;event2=click&amp;event3=1+%2F+%5B8%5D+%5BCONTEXT%5D+%CA%EE%ED%F2%E5%EA%F1%F2%ED%FB%E9+%E1%E0%ED%ED%E5%F0+Microsoft&amp;goto=http://clk.atdmt.com/MRR/go/199659073/direct/01/\">бюджетных</a> Linux-лаптопах OLPC XO. В своих докладах они осветили два популярных  редактора растровой графики для Linux: GIMP и TuxPaint. Кроме того,  Малакай продемонстрировала небольшое видео, созданное ей с помощью  программы OpenShot.</p>\r\n<p>Заинтересованность к Open Source-движению девочкам привили их отцы.  Так, папа Малакай &mdash; Карстен Уэйд (Karsten Wade) &mdash; сотрудник  Linux-компании Red Hat, а отец Мирано &mdash; Ларри Кафьеро (Larry Cafiero) &mdash;  работает литературным редактором в издании &laquo;Santa Cruz Sentinel&raquo; и  является Open Source-энтузиастом по жизни, помогая в организации  различных мероприятий для сообщества.</p>', '0', '', '', '', ''),('51695', '51580', '2', '10', '0', '0', '1267705021', '1327688576', '23% немцев согласны на внедрение микрочипа', '0', '0', '0', '0', '0', '0', '', '/uploads/users/2/2012/01/27/6b7ed731452897a9bb1f7b4bb0e3cb7d_5B1_5D_1267705072_1__1327679841.jpg', '<p>В ходе опроса, проведенного немецкой ассоциацией IT-компаний  BITKOM,   выяснилось, что каждый четвертый немец (23 % из 1000 опрошенных)   готов  вживить себе под кожу микрочип, если это принесет ему   &quot;определенные  выгоды&quot;.<!-- pagebreak --></p>\r\n<p>Почти каждый шестой респондент заявил при этом, что согласен на  имплантацию, для того чтобы в случае аварии или другой опасной для жизни  ситуации его могли бы быстро обнаружить и спасти. Еще пять процентов  полагают, что микрочип поможет им лучше управляться с шоппингом.</p>\r\n<p>Однако подавляющее большинство - 72 % респондентов - заявили о том,  что ни при каких обстоятельствах не согласятся вживить себе под кожу  микрочип.</p>\r\n<p>Опрос проводился в преддверии открытия в ФРГ крупнейшей  международной выставке электроники CeBIT. Накануне открытия выставки  министр по защите прав потребителей Ильза Айгнер призвала граждан ФРГ  остерегаться крупных IT-корпораций: Google, Apple и  <a href=\"http://www.securitylab.ru/bitrix/rk.php?id=8&amp;event1=banner&amp;event2=click&amp;event3=1+%2F+%5B8%5D+%5BCONTEXT%5D+%CA%EE%ED%F2%E5%EA%F1%F2%ED%FB%E9+%E1%E0%ED%ED%E5%F0+Microsoft&amp;goto=http://clk.atdmt.com/MRR/go/199659073/direct/01/\">Microsoft,</a> а также социальных сетей таких, как <a class=\"lnk\" href=\"http://www.securitylab.ru/news/382591.php\">Facebook.</a> По ее словам, IT-компании располагают огромными базами данных  пользователей, и никто не знает, каким образом эти данные используются.</p>', '0', '', '', '', '/uploads/users/2/2012/01/27/Clipboard02_1287254184_1__1327688595.jpg'),('51696', '51580', '2', '40', '0', '0', '1267705294', '1327832398', 'Новый антивирус Яндекса обнаружил вирус на сайте ООН', '0', '0', '0', '0', '0', '0', '', '/uploads/users/2/2012/01/27/1e9d4ec7132a9178aa376f45f29c3aa5_5B1_5D_1267705324_1__1327679993.jpg', '<p>Яндекс, запустивший в сегодня собственный <a class=\"lnk\" href=\"http://www.securitylab.ru/software/1250/\">антивирус,</a> обнаружил  вредоносную программу на сайте Организации объединенных наций  (ООН).<!-- pagebreak -->При введении поискового запроса &quot;ООН&quot; на сайте поисковика появляется  предупреждение следующего содержания: &quot;Сайт может угрожать безопасности  вашего компьютера. Посещение этого сайта может привести к заражению  компьютера вредоносными программами, использованию его без вашего  ведома, а также к порче или краже ваших данных&quot;.<br> <br> Пресс-секретарь &quot;Яндекса&quot; Очир Манджиков подтвердил РИА Новости  обнаружение <a class=\"lnk\" href=\"http://www.securitylab.ru/virus/\">вируса</a> на сайте ООН, а также сообщил, что компания направила соответствующее  уведомление владельцам сайта.<br> <br> &quot;Действительно, согласно нашим данным, на страницах сайта ООН находится  вредоносный код. Мы направили уведомление владельцам сайта ООН, что на  их сайте обнаружен вирус&quot;, - сказал Манджиков.<br> <br> Он пояснил, что в данный момент вредоносный код не активен и ссылается  на уже не существующий домен, но если кто-то зарегистрирует домен  заново, то есть вероятность, что код может активироваться. По словам  Манджикова, злоумышленникам удалось внедрить вредоносный код в несколько  страниц сайта ООН.<br> <br> &quot;В большинстве случаев это означает, что существует уязвимость, которая  может быть использована вновь. Удаление вредоносного кода служит для нас  сигналом о том, что на  <a href=\"http://www.securitylab.ru/bitrix/rk.php?id=8&amp;event1=banner&amp;event2=click&amp;event3=1+%2F+%5B8%5D+%5BCONTEXT%5D+%CA%EE%ED%F2%E5%EA%F1%F2%ED%FB%E9+%E1%E0%ED%ED%E5%F0+Microsoft&amp;goto=http://clk.atdmt.com/MRR/go/199659073/direct/01/\">безопасность</a> сайта было обращено внимание его владельцев. С сайтов www.un.org этого  пока что не произошло&quot;, - добавил представитель &quot;Яндекса&quot;.</p>', '0', '', '', '', ''),('51697', '51580', '2', '50', '0', '0', '1267705358', '1327688613', '17-летний житель Пенсильвании признался, что внедрил вирус на сайт PlayStation.com', '0', '0', '0', '0', '0', '0', '', '/uploads/users/2/2012/01/27/32d6b4a87c0ba990bd1d43a9437e58e4_5B1_5D_1267705387_1__1327680045.gif', '<p>17-летний житель Пенсильвании признался в зале суда, что в ноябре 2008   года внедрил <a class=\"lnk\" href=\"http://www.securitylab.ru/virus/\">вирус</a> на сайт PlayStation.com. Из-за этого в течение 10 дней на ресурсе   происходили внутренние сбои.<!-- pagebreak --></p>\r\n<p>Подросток из городка Гринсбург, Пенсильвания, США, обиделся на Sony &mdash;  компания заблокировала его аккаунт в игровой сети Playstation Network.  Причиной блокировки стало обвинение в жульничестве: парень использовал  чит-коды в игре-шутере Socom: US Navy Seals.<br> <br> Школьник не остался в долгу и взломал веб-сайт компании. По информации  TG Daily, он запустил на ресурс вирус, в результате чего &laquo;обрушились&raquo;  несколько  <a href=\"http://www.securitylab.ru/bitrix/rk.php?id=8&amp;event1=banner&amp;event2=click&amp;event3=1+%2F+%5B8%5D+%5BCONTEXT%5D+%CA%EE%ED%F2%E5%EA%F1%F2%ED%FB%E9+%E1%E0%ED%ED%E5%F0+Microsoft&amp;goto=http://clk.atdmt.com/MRR/go/199659073/direct/01/\">серверов</a> и в период с 16 по 26 ноября 2008 года PlayStation.com работал с  перебоями.<br> <br> Хакера вычислили специалисты из ФБР. В ходе судебного разбирательства  подросток полностью признал свою вину. Действия взломщика суд  квалифицировал как &laquo;мелкое уголовное преступление&raquo;. Сейчас подсудимого  отпустили домой, но он должен еще раз явиться в суд для оглашения  приговора.<br> <br> Имя взломщика не разглашается, так как он является несовершеннолетним.  Известно, что он учится в старших классах средней школы г. Лэйтроб,  Пенсильвания, получает отличные отметки и числится на хорошем счету у  преподавателей.</p>', '0', '', '', '', '/uploads/users/2/2012/01/27/Clipboard02_1287254498_1__1327688618.jpg'),('51698', '51580', '2', '0', '0', '0', '1267705418', '1327680126', 'Хакер Нео продолжает публиковать данные', '0', '0', '0', '0', '0', '0', '', '/uploads/users/2/2012/01/27/1976170a3f843341d5a29539e701edf8_5B1_5D_1267705460_1__1327680129.jpg', '<p>Хакер, похитивший более 7 миллионов документов из системы   электронного  декларирования Службы государственных доходов Латвии, в   пятницу  опубликовал в Интернете данные по зарплатам сотрудников   государственной  Комиссии по рынкам финансов и капитала(КРФК).<!-- pagebreak --></p>\r\n<p>Об утечке 120 гигабайт информации (более 7 миллионов электронных  документов) из латвийской налоговой службы стало известно 14 февраля.  Это самая крупная кража информации в истории страны. Через несколько  дней на связь с журналистам вышел хакер по прозвищу Нео, представляющий,  по его словам, организацию под названием &quot;Народная армия четвертого  возрождения&quot;, которая борется за благополучие Латвии.</p>\r\n<p>Нео уже опубликовал в Интернете данные о зарплатах сотрудников  рижского муниципального предприятия Rigas Satiksme (&quot;Рижское  сообщение&quot;), которое отвечает за общественный транспорт в городе, и  предприятия Rigas Siltums, которое обеспечивает теплоснабжение города.  Руководители предприятий подтвердили, что опубликованные Нео данные  являются подлинными.</p>\r\n<p>В пятницу Нео опубликовал в Интернете данные о зарплатах в  государственной Комиссии рынков финансов и капитала. Согласно  опубликованным данным, большинство сотрудников ведомства получают  зарплаты от 1000 латов (2000 долларов) до 7 тысяч латов (14 тысяч  долларов). Руководство КРФК пока никак не прокомментировала  обнародование данных в Интернете.</p>\r\n<p>По факту утечки информации из СГД полиция Латвии возбудила уголовное  дело. Полиция безопасности считает, что конфиденциальной информацией о  высших должностных лицах Латвии, коммерческих компаниях и физических  лицах, а также о сотрудниках канцелярии президента Латвии и других  госструктур могут воспользоваться преступники.</p>', '0', '', '', '', ''),('51699', '51580', '2', '0', '0', '0', '1268224013', '1327680158', '13 марта крупнейший в мире видеохостинг YouTube прекратит поддержку браузера Internet Explorer 6', '0', '0', '0', '0', '0', '0', '', '/uploads/users/2/2012/01/27/fc832950b152b0cc98d1e31efe588019_5B1_5D_1267705640_1__1327680176.jpg', '<p>13 марта крупнейший в мире видеохостинг YouTube прекратит поддержку    браузера Internet Explorer 6, то есть начиная с этого дня новые функции    YouTube не будут работать в этом браузере, хотя пользователи Internet    Explorer 6 по-прежнему смогут просматривать видеоконтент.<!-- pagebreak --></p>\r\n<p>Те пользователи, которые еще не перешли на более новые версии браузеров,  увидят крупное уведомление. В нем будут перечислены браузеры и версии,  поддерживающие все функции YouTube, а именно: Google Chrome, Opera 10,  Internet Explorer 8, Safari 4 и Firefox 3.6. <br> <br> Ранее о намерении сконцентрироваться на поддержке более современных  браузеров объявила администрация сервиса ссылок Digg, а также  представители некоторых других ресурсов.<br> <br> В настоящее время в российском сегменте интернета браузером Internet  Explorer 6.0 продолжают пользоваться более 10% пользователей.</p>', '0', '', '', '', ''),('51700', '51580', '2', '0', '0', '0', '1267792053', '1327680205', 'Джобс: Flash - &quot;пожиратель процессорных ресурсов&quot;', '0', '0', '0', '0', '0', '0', '', '/uploads/users/2/2012/01/27/Clipboard02_jpg_1282980694_1__1327680219.png', '<p>На встрече с представителями Wall Street Journal, посвященной    обсуждению планшетного компьютера iPad, глава корпорации Apple Стив    Джобс негативно отзывался о мультимедийной технологии Adobe Flash.</p>\r\n<p>Джобс заявил, что Flash пожирает ресурсы процессора и полон  уязвимостей в подсистеме безопасности. Глава Apple был категоричен: &quot;Мы  не собираемся тратить силы на устаревшую технологию&quot;.</p>\r\n<p>В ходе беседы Стив Джобс сравнил Flash с рядом изживших себя  продуктов и технологий, от которых Apple в свое время избавилась:  дисководы гибких дисков, старые порты передачи данных (например,  FireWire 400) и даже компакт-диски (на смену им пришли iPod и iTunes).  Использование Flash, по его мнению, уменьшит время автономной работы  iPad с 10 часов до всего лишь 90 минут.</p>\r\n<p>Джобс посоветовал изданию отказаться от Flash в пользу  альтернативных решений &mdash; HTML5 и видеокодека H.264.</p>', '0', '', '', '', ''),('51701', '51580', '2', '0', '0', '0', '1278502146', '1327680246', 'Хакера приговорили к 309 годам лишения свободы', '0', '0', '0', '0', '0', '0', 'Хакер, Роберт Томпсон, Robert Thompson', '/uploads/users/2/2012/01/27/b027dbfc60fed47c62a1568bb77963a5_5B1_5D_1267705769_1__1327680263.jpg', '<p>43-летнего жителя Луизианы признали виновным в девяти видах    мошенничества: почтовом, банковском, компьютерном, электронном и др.    Обвинительное заключение стало одним из самых длинных в истории штата.<!-- pagebreak --></p>\r\n<p>Роберт Томпсон (Robert Thompson), житель городка Закари в восточной  части Луизианы, в период с 2006 по 2008 гг. похитил с банковских счетов  своих жертв около $100 тыс. Но удача способствовала Томпсону далеко не  во всех его предприятиях &mdash; суд заключил, что преступник изначально  намеревался украсть около $20 млн. Отягчающим обстоятельством был также  признан тот факт, что в момент совершения ограблений Томпсон находился в  тюрьме.<br> <br> Томпсон действовал не один &mdash; в помощники он нанял двух сотрудников  тюрьмы и еще нескольких человек &laquo;на воле&raquo;. Разработанная преступником  схема позволяла получать номера кредитных карт и другую финансовую  информацию, причем объектами его атак чаще всего становились пожилые  люди, передает 2theadvocate.com. Подробности схемы пока не раскрываются.<br> <br> Томпсону предъявили обвинение в мошенничестве по предварительному  сговору, мошенничестве с использованием электронных средств  коммуникации, почтовом мошенничестве, банковском мошенничестве,  компьютерном мошенничестве, мошенничестве с целью получить доступ к  электронному устройству, мошенничестве с целью завладеть личной  информацией, отмывании денег и создании помех правосудию. Преступника  приговорили к 309 годам тюрьмы &mdash; это самый длительный срок в истории  местного правосудия. Адвокаты Томпсона заявили, что будут обжаловать  приговор.<br> <br> Свой второй срок Томпсон будет отбывать в другой тюрьме &mdash; с более  строгим режимом и менее сговорчивым персоналом.</p>', '0', '', '', '', ''),('51702', '51580', '2', '0', '0', '0', '1284569601', '1327680285', 'Ультраортодоксальные секс-коммандос взламывают еврейские порносайты', '0', '0', '0', '0', '0', '0', 'Хакеры, израильские порносайты', '', '<p>Подпольная группа ультраортодоксальных евреев-хакеров взламывает израильские порносайты и размещает на них фотографию любавического ребе, известного мудреца Торы и основателя хабаднического движения, передает агентство Ynet.<!-- pagebreak --></p>\r\n<p>Представители интернет-сообщества уже называют ревнителей благочиния &quot;ультраортодоксальными секс-коммандос&quot; или &quot;ультроортодоксальным электронным подпольем&quot;.</p>\r\n<p>Первой жертвой евреев-хакеров стал один из малопопулярных в определенных кругах ресурсов с откровенным видео. Помимо фотографии на взломанном сайте появился текст: &quot;Мы, религиозная интернет-группа, взломали этот сайт и стерли все непристойности&quot;. Хакеры также опубликовали там список других сайтов, которые они планировали закрыть.</p>\r\n<p>Кроме того, в послании представители &quot;ультраортодоксального подполья&quot; напомнили любителям порнографии, что, &quot;как предупреждает священная Каббала, грех напрасной траты семени является причиной большнства болезней и несчастий&quot;.</p>\r\n<p>На данный момент в Израиле располагаются около 40 порносайтов и до 20 интернет-форумов сексуального содержания. &quot;Секс-коммандос&quot; пытались взломать и другие ресурсы, однако без определенного успеха, отмечает агентство.</p>\r\n<p>Между тем на минувшей неделе был взломан ультраортодоксальный сайт &quot;Шофар&quot;. Злоумышленники заменили религиозное содержание материалами против цензуры и религии. Связан ли этот инцидент с действиями &quot;ультраортодоксального подполья&quot;, пока не ясно.</p>', '0', '', '', '', ''),('51703', '51580', '2', '0', '0', '0', '1287250137', '1327680314', 'Программистов сменят Шимпанзе', '0', '0', '0', '0', '0', '0', '', '/uploads/users/2/2012/01/27/Clipboard02_1287259251_1__1327680328.png', '<p>Низкоквалифицированных программистов сменят бабуины и шимпанзе. Американские ученые обнаружили у высших приматов способности к работе с компьютером. <!-- pagebreak -->На основании результатов исследования ученые предсказывают, что в течение десяти лет большинство примитивных операций в программировании или при тестировании программ будут выполняться обезьянами. Об этом сообщает NEWSru со ссылкой на Primate Programming Inc.</p>\r\n<p>Доктор Джеймс МакОлифф из Стэмфордской зоологической школы провел ряд экспериментов по обучению бабуинов работе с переносными персональными компьютерами.</p>\r\n<p>&quot;Бабуины и шимпанзе вполне могут работать с компьютерами, заниматься тестированием программного обеспечения и даже программировать. Правда у них возникают некоторые трудности со сложноструктурированными меню. Если в меню больше двух уровней, то для бабуина оно уже представляет сложность&quot;, - говорит МакОлифф.</p>\r\n<p>Настойчивым ученым удалось решить и эту проблему. МакОлифф выяснил, что если показать бабуину, что многоуровневое меню ведет к некой заветной картинке, то самец бабуина способен осознать и запомнить до семи уровней в меню.</p>\r\n<p>После простейшего курса по работе с Windows, бабуинам было предложено ознакомиться с новейшими достижениями в области программного обеспечения. Бабуины были потрясены и озадачены программами Java IDE, SunONE и Visual Age. Ни один из бабуинов так и не смог освоить язык программирования Java.</p>\r\n<p>Однако большинство бабуинов с легкостью освоило язык программирования Visual Basic 3.0. Бабуины смогли самостоятельно менять программные настройки и даже редактировать параметры атрибутов файлов. Некоторые исследователи заявили, что Visual Basic слишком прост для бабуинов. Они настаивают на том, чтобы обезьяны прошли еще один курс обучения Java-программированию. Однако у большинства бабуинов и шимпанзе любые компоненты Java, по словам ученых, вызывают стресс.</p>\r\n<p>МакОллиф также обнаружил, что бабуины выступают против политики &quot;открытого кода&quot;. Как только бабуин становится способен нажимать нужные клавиши на клавиатуре лэптопа или пользоваться сложными меню, его социальный статус среди сородичей резко возрастает. Свои знания бабуины охраняют от соперников с помощью кулаков.</p>\r\n<p>Выводы исследования, проведенного МакОллифом, уже вызвали ажиотаж среди разработчиков программного обеспечения. Несколько крупных компаний, по данным сайта, уже объявили о том, что будут финансировать дальнейшие исследования в этой области. Положительные результаты могут серьезно уменьшить расходы этих компаний на содержание низкоквалифицированных программистов, занимающихся тестированием новых продуктов.</p>', '0', '', '', '', ''),('51704', '51580', '2', '0', '0', '0', '1274268157', '1327680348', 'Интересный стул, лавочка и т.п.', '0', '0', '0', '0', '0', '0', '', '', '<p>\r\n<object data=\"http://www.youtube.com/v/g-OOGDeZjMk?fs=1&amp;hl=ru_RU\" type=\"application/x-shockwave-flash\" height=\"385\" width=\"700\">\r\n<param name=\"data\" value=\"http://www.youtube.com/v/g-OOGDeZjMk?fs=1&amp;hl=ru_RU\">\r\n<param name=\"src\" value=\"http://www.youtube.com/v/g-OOGDeZjMk?fs=1&amp;hl=ru_RU\">\r\n</object>\r\n</p>\r\n<p><!-- pagebreak --></p>\r\n<p>Еще немного видео:</p>\r\n<p>\r\n<object data=\"http://www.youtube.com/v/DtCU43MteYY?fs=1&amp;hl=ru_RU\" type=\"application/x-shockwave-flash\" height=\"385\" width=\"700\">\r\n<param name=\"data\" value=\"http://www.youtube.com/v/DtCU43MteYY?fs=1&amp;hl=ru_RU\">\r\n<param name=\"src\" value=\"http://www.youtube.com/v/DtCU43MteYY?fs=1&amp;hl=ru_RU\">\r\n</object>\r\n<object data=\"http://www.youtube.com/v/NAllFWSl998?fs=1&amp;hl=ru_RU\" type=\"application/x-shockwave-flash\" height=\"385\" width=\"700\">\r\n<param name=\"src\" value=\"http://www.youtube.com/v/NAllFWSl998?fs=1&amp;hl=ru_RU\">\r\n</object>\r\n</p>', '0', '', '', '', ''),('51705', '51580', '2', '0', '0', '0', '1280988905', '1327680368', 'Интерпритация старого по новому', '0', '0', '0', '0', '0', '0', '', '', '<p>\r\n<object data=\"http://www.youtube.com/v/gT2Iii0Psao?fs=1&amp;hl=ru_RU\" type=\"application/x-shockwave-flash\" height=\"385\" width=\"700\">\r\n<param name=\"src\" value=\"http://www.youtube.com/v/gT2Iii0Psao?fs=1&amp;hl=ru_RU\">\r\n</object>\r\n</p>\r\n<p><!-- pagebreak -->Как считаете, а если так переделать старые клипы, стали бы они новыми?</p>\r\n<p>Заметили, что эта новость не выводится в общем списке новостей, это потому, что у нее возле пункта Страница блога: не стоит галочка.</p>', '0', '', '', '', ''),('51706', '51580', '2', '0', '0', '0', '1279176885', '1329489402', 'Десятка самых ужасных преступлений в Интернете', '0', '2', '0', '0', '9', '1', '', '', '<p>Издание Cnet составило список десяти онлайновых преступлений, в результате которых был причинен особо крупный ущерб.<!-- pagebreak -->10. Банковский <span class=\"lnk\">троян</span> - 300 тыс. евро.</p>\r\n<p>Осенью этого года сотни вкладчиков немецких банков были шокированы,  увидев нулевые остатки на своих счетах. Они стали жертвами действия  банковского трояна URLzone. По оценкам специалистов, результатом  деятельности этого <span class=\"lnk\">вируса</span> стало исчезновение со счетов немецких граждан более 300 тыс. евро.  Сайты, зараженные вирусом, посетили более 90 тыс. человек. Специалисты  подозревают, что управление действиями трояна ведется с территории  Украины.</p>\r\n<p>9. Крах банка Ginko в виртуальном мире Second Life &ndash; 440 тыс. фунтов стерлингов.</p>\r\n<p>Около 18 тыс. человек потеряли сотни миллионов лиднен-долларов (или  порядка полумиллиона фунтов стерлингов) в результате банкротства  виртуального банка Ginko. До банкротства в банке находились сбережения  жителей онлайнового мира на сумму более $700 тыс. (или 190 млн  линден-долларов, курс этой валюты относительно к доллару составляет 270 к  одному).</p>\r\n<p>Официальной причиной банкротства стало массовое снятие денег со  счетов в Ginko в результате запрета на азартные игры в Second Life. За  неделю виртуальный банк обанкротился, и те, кто не успел забрать свои  вложения, остались ни с чем. Специалисты подозревают, что это была  запланированная акция.</p>\r\n<p>8. Отмывание денег через <span class=\"lnk\">iTunes</span> - $750 тыс.</p>\r\n<p>Группа преступников записала 19 композиций и выставила их на продажу  в Apple iTunes Store и Amazon. Купившие эти песни в одночасье лишались  номеров кредитных карт. После этого с кредиток было украдено $750 тыс.</p>\r\n<p>7. Фишинг-атака на банк Nordea - $1,1 млн.</p>\r\n<p>Злоумышленники украли более миллиона долларов (или 8 млн шведских  крон) с помощью классической фишинг-атаки. Клиенты банка Nordea получили  электронные письма от имени администрации, в которых рекомендовалось  установить специальную программу, якобы защищающую клиентов от спама и  интернет-атак. 250 человек установили это приложение и потеряли свои  деньги. В <span class=\"lnk\">компьютеры</span> пользователей проник троян, собиравший логины, пароли, номера счетов,  пин-коды. В этой атаке владельцы банка подозревают русских хакеров.</p>\r\n<p>6. Атака на Citibank - $2 млн.</p>\r\n<p>Злоумышленники взломали банкоматы и получили доступ к пин-кодам  пользователей. Кражи кодов производились более полугода. Конкретное  число украденных кодов до сих пор не известно. Сумма, которую удалось  украсть злоумышленникам &ndash; более $2 млн. Подозреваемые в этом деле были  арестованы в марте 2008 года. Это Юрий Ракущинец (Yuriy Rakushchynets),  Иван Билце (Ivan Biltse) и Анжелина Китаева (Angelina Kitaeva).</p>\r\n<p>5. Атака по беспроводному соединению &ndash; 1,8 млрд фунтов стерлингов.</p>\r\n<p>Эта атака была осуществлена в результате подключения к системе  безопасности процессингового центра компании CardSystems Solutions Inc.  Внедренный в систему вирус передавал злоумышленникам данные об имени  владельца кредитной карты, банке и номере счета. В результате  злоумышленники завладели более чем 40 млн номеров кредитных карт.  Специалисты назвали это преступление крупнейшим делом о взломе и краже  личных данных. Еще одна атака подобного рода была проведена в США, когда  11 злоумышленников по беспроводному соединению внедрились в  компьютерные сети крупных магазинов &ndash; TJX Companies, Barnes &amp; Noble,  Sports Authority. И в первом, и во втором случае похищенные номера  кредитных карт продавались на российских и американских сайтах.</p>\r\n<p>4. Банкоматный флешмоб - $9 млн.</p>\r\n<p>Получив доступ к номерам более чем 1,5 млн зарплатных банковских  карт и 1,1 млн номеров социального страхования, в один и тот же день и  час злоумышленники сняли наличность в 49 городах США со 130 банкоматов.  Вся операция длилась не более 30 минут. Деньги были переведены на счета в  США, России, Эстонии, Украине. Специалисты называют эту атаку одной из  самых изощренных в мире.</p>\r\n<p>3. Повторная атака Гонсалеса &ndash; 130 млн кредиток, 8 млн фунтов стерлингов.</p>\r\n<p>Альберт Гонсалес &ndash; это хакер, который принимал участие в  беспроводной атаке на компьютерные сети магазинов (см. п. 5). В этом  году его обвинили в еще одном преступлении &ndash; в результате атаки на  систему электронных расчетов Heartland Payment Systems сетей магазинов  7-Eleven и Hannaford Brothers злоумышленник завладел более чем 130 млн  номеров кредитных карт и снял с них сумму в 8 млн фунтов стерлингов.  Хакер был арестован. Во время ареста у него было изъято $1,65 млн  наличными.</p>\r\n<p>2. Гениальное разоблачение &ndash; закрытие <span class=\"lnk\">форума</span> Darkmarket, более $70 млн сохраненных денег.</p>\r\n<p>Этот случай &ndash; не преступление, а разоблачение. В 2008 году ФБР и  полиция Великобритании закрыли сайт DarkMarket &ndash; форум, на котором  хакеры обменивались краденой финансовой информацией. Одновременно с этим  были арестованы 56 киберпреступников в Англии, Германии, США и Турции. В  результате закрытия форума удалось предотвратить махинации на сумму  порядка $70 млн. Сайт успешно работал около трех лет. Последние два года  на сайте под прикрытием общались сотрудники ФБР. Доступ к Darkmarket  был возможен только по личному приглашению.</p>\r\n<p>1. Бразильский фишер &ndash; более 30 млн фунтов стерлингов.</p>\r\n<p>Недавно арестованный бразильский фишер Валдир Пауло де Алмейда  (Valdir Paulo de Almeida) был руководителем преступной группировки,  подозревавшейся в похищении более $37 млн с банковских счетов. В его  команду входило 18 хакеров, которые использовали для кражи денег  фишинг-атаки и трояны. Эта преступная группировка ежедневно рассылала  пользователям более трех миллионов зараженных электронных писем.</p>', '0', '', '', '', '');
