CREATE TABLE `you_prefix_table_subscribe` (   `id` int(11) NOT NULL AUTO_INCREMENT,   `user_id` int(10) unsigned NOT NULL DEFAULT '0',   `variant_id` int(10) unsigned NOT NULL DEFAULT '0',   `time_add` int(10) unsigned NOT NULL DEFAULT '0',   `subscribe` tinytext CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,   UNIQUE KEY `id` (`id`) ) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_bin;
CREATE TABLE `you_prefix_table_subscribe_pages_comments` (   `page_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'Идентификатор страницы',   `user_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'Идентификатор пользователя',   `unsubscribe` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT 'Отписан от рассылок (0 - нет, 1 - да)',   `time_lastmail` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'Дата отправления последнего письма',   `time_subscribe` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'Время, когда пользователь подписался',   `time_unsubscribe` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'Время, когда пользователь отписался',   UNIQUE KEY `page_id__user_id` (`page_id`,`user_id`),   KEY `page_id` (`page_id`),   KEY `user_id` (`user_id`),   KEY `unsubscribe` (`unsubscribe`) ) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='Страницы и пользователи, которые подписаны на них';
CREATE TABLE `you_prefix_table_subscribe_variants` (   `variant_id` int(11) NOT NULL AUTO_INCREMENT,   `position` int(10) unsigned NOT NULL DEFAULT '0',   `name` tinytext CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,   `comment` tinytext CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,   UNIQUE KEY `id` (`variant_id`) ) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_bin;
CREATE TABLE `you_prefix_table_unsubscribe` (   `email` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT 'Е-mail',   `email_failed` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT 'Фиктивный емэйл-адрес (0 - нет, 1 - да)',   `unsubscribe` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT 'Отписан от рассылок (0 - нет, 1 - да)',   `uniq_hash` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT 'Хэш благодаря которому E-mail отписывается',   `time_lastmail` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'Дата отправления последнего письма',   `time_unsubscribe` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'Время, когда пользователь отписался',   UNIQUE KEY `email` (`email`) ) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_bin;
CREATE TABLE `you_prefix_table_users_pages` (   `user_id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор пользователя',   `user_page` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT 'Имя страницы (субдомена)',   PRIMARY KEY (`user_id`),   UNIQUE KEY `subdomain` (`user_page`) ) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='Красивые страницы пользовательских адресов';
